import Expenses from "./components/Expenses"
import NewExpense from "./components/NewExpense/NewExpense";

function App() {
  let expenses = [
    { date: new Date(2020, 1, 1), title: "Movie Tickets", amount: 600 },
    { date: new Date(2021, 11, 5), title: "Food", amount: 1000 },
    { date: new Date(2022, 9, 9), title: "Travel", amount: 300 },
    { date: new Date(2019, 10, 11), title: "Other", amount: 100 },
  ];

  const displayImportedExpense = (importedExpense) => {
    expenses = { ...expenses, importedExpense };
    console.log(expenses);
  }
  return (
    <div>
      <h2>Let's get started!</h2>
      <NewExpense onImport={displayImportedExpense}/>
      <Expenses expenseData={expenses}/> 
    </div>
  );
}

export default App;
